    <div className="landing-container">
      {/* Navbar */}
      <nav className="navbar">

  {/* Left links */}
  <ul className="nav-left">
  <div className="logo">Advanced To Do</div>
    <li className="active">HOME</li>
    <li>DASHBOARD</li>
    <li>EMPLOYEES</li>
    <li>DEPARTMENTS</li>
  </ul>

  {/* Right buttons */}
  <div className="nav-right">
    <button className="login-btn">LOGIN</button>
    <button className="signup-btn">SIGNUP</button>
  </div>
</nav>
      {/* Hero Section */}
      <section className="hero-section">
        <div className="hero-card">
          <h1>stay organized, <br /> stay focused, <br /> achieve your goals effortlessly!</h1>
          <p><b>Manage tasks, set deadlines, <br />and get smart reminders â€” making productivity simple and effective!</b></p>
          <button className="dashboard-btn">Dashboard</button>
        </div>
      </section>

    </div>
  );
};

export default LandingPage;
